import styles from "./Movies.module.css";

function Movies() {
  return (
    <div className={styles.container}>
      <section className={styles.movies}>
        <h2 className={styles.movies__title}>
          <u>Latest Movies</u>
        </h2>
        <div className={styles.movie__container}></div>
      </section>
    </div>
  );
}

export default Movies;
